abstract contract BlackList {
    mapping (address => bool) private _isBlackListed;

    /**
     * @dev Emitted when the `_account` blocked.
     */
    event BlockedAccount(address indexed _account);

    /**
     * @dev Emitted when the `_account` unblocked.
